            function ChartLoad() {
                CanvasJS.addColorSet("White", ["#F1C40F"]);

                CanvasJS.addColorSet("Gray", ["#D7DBDD"]);

                var chartActual = new CanvasJS.Chart("chartContainerActual", {
                    backgroundColor: "transparent",
                    colorSet: "White",
                    title: {
                        fontSize: 20,
                        fontFamily: "tahoma",
                        fontColor: "white",
                        text: " ",
                    },

                    //animationEnabled: true,
                    axisY: {
                        tickThickness: 1,
                        gridThickness: 1,
                        //interval:120,
                        title: "Effeciency (%)",
                        titleFontColor: "yellow",
                        labelFontColor: "white",
                        labelFontSize: 16,
                    },
                    axisX: {
                        title: "Hour",
                        interval: 1,
                        titleFontColor: "yellow",
                        labelFontSize: 15,
                        labelFontColor: "white",
                    },
                    toolTip: {
                        enabled: true, //enable here
                    },
                    legend: {
                        verticalAlign: "bottom",
                        horizontalAlign: "center",
                    },
                    dataPointMaxWidth: 50,
                    data: [
                        {
                            type: "splineArea",
                            lineThickness: 3,
                            markerSize: 10,
                            showInLegend: false,
                            indexLabel: "{y}%",
                            indexLabelFontColor: "#ffffff",
                            legendMarkerColor: "white",
                            legendText: "",
                            dataPoints: [
                                { y: 48, label: "1" },
                                { y: 49, label: "2" },
                                { y: 0, label: "3" },
                                { y: 0, label: "4" },
                                { y: 0, label: "5" },
                                { y: 0, label: "6" },
                                { y: 0, label: "7" },
                                { y: 0, label: "8" },
                            ],
                        },
                    ],
                });
                chartActual.render();
            }

            function ChartShow() {
                var ChartDivi = document.getElementById("ChartDiv").style.display;
                if (ChartDivi == "none") {
                    document.getElementById("ChartDiv").style.display = "block";
                    document.getElementById("fullCover").style.display = "block";
                    document.getElementById("iconn").style.color = "yellow";
                    ChartLoad();
                } else {
                    //document.getElementById("ChartDiv").style.display = "none";
                    document.getElementById("iconn").style.color = "gray";
                }
            }

            var elem = document.documentElement;
            function openFullscreen() {
                if (confirm("Are you sure you want enable Fullscreen Mode..?") == true) {
                    if (elem.requestFullscreen) {
                        elem.requestFullscreen();
                    } else if (elem.webkitRequestFullscreen) {
                        /* Safari */
                        elem.webkitRequestFullscreen();
                    } else if (elem.msRequestFullscreen) {
                        /* IE11 */
                        elem.msRequestFullscreen();
                    }
                }
            }
